<script lang='ts'>
  import { onMount } from 'svelte'
  import { Ghost } from '../ghost'

  let disgruntledGhost:Ghost;
  let interroGhost:Ghost;
  let bangGhost:Ghost;
  let wallGhost:Ghost;
  
  let disgruntledEctoplasm:SVGGraphicsElement;
  let interroEctoplasm:SVGGraphicsElement;
  let bangEctoplasm:SVGGraphicsElement;
  let wallEctoplasm:SVGGraphicsElement;
  
  let disgruntledShadow:SVGEllipseElement;
  let interroShadow:SVGEllipseElement;
  let bangShadow:SVGEllipseElement;
  let wallShadow:SVGEllipseElement;
  
  let interro:SVGGraphicsElement;
  let bang:SVGGraphicsElement;
  let steam:SVGGraphicsElement;

  let bangSweat:SVGGraphicsElement;
  let sweatKeys:Keyframe[]=[
    {y2: 1, x2: 0 },
    {y2: 0, x2: 1 },
    {y2: -1, x2: 0 },
    {y2: 0, x2: -1 }
  ];
  let zoom:Keyframe[] = [
        {transform: 'scale(.98)'},
        {transform: 'scale(1.01)'},
      ];
  let zoomOptions:KeyframeAnimationOptions = {
    direction: Math.random() > .49 ? 'alternate' : 'alternate-reverse',    
    duration: 5000*Math.random() + 2500,
        easing: 'ease-in-out', 
        iterations: Infinity,
        composite: 'accumulate'
      }

  let timing:KeyframeAnimationOptions = {
    direction: 'alternate',
    duration: 3000,
    easing: 'ease-in-out',
    iterations: Infinity,
    composite: 'accumulate'
  }

  onMount(()=>{
    disgruntledGhost = new Ghost(disgruntledEctoplasm, disgruntledShadow);
    interroGhost = new Ghost(interroEctoplasm, interroShadow);
    bangGhost = new Ghost(bangEctoplasm, bangShadow);
    wallGhost = new Ghost(wallEctoplasm, wallShadow);
    for(let ghost of [disgruntledGhost, interroGhost, bangGhost, wallGhost]) {
      ghost.hover();
      // ghost.applyAnimation(zoom, zoomOptions);
    }
    bangSweat.animate(sweatKeys, timing);
  });

</script>
